import React from 'react';
import classes from './Sidebar.module.css';
import MenuItem from './MenuItem/MenuItem';

const sidebar = (props) => {

    let data = [
        {link: 'Home',
        subLink: ['test1', 'test2', 'test3', 'test4']},
        {link: 'Media',
        subLink: ['test1', 'test2', 'test3', 'test4']},
        {link: 'Shop',
        subLink: ['test1', 'test2', 'test3', 'test4'] },

    ]

    let AllItems = data.map((dataItem, index) => {
        return (
            <div className={classes.NavList}>
            <ul>

                <li key={index}>

                    <div className={classes.Header}>

                       <h3> <a href='/'>{dataItem.link}</a> </h3>

                        </div>


                    {dataItem.subLink.map((arrayItem, index) => {
                       return (<li>{arrayItem}</li>)
                    })}


                </li>
            </ul>

            </div>
        )
    }
    )

    return (
    <div className={classes.Sidebar}>
        <li>Landy Pandy</li>
        {AllItems}
    </div>
    )
    };
export default sidebar;
